 //页面与编号之间的对应关系
 getNumberByPageId(lastPageData, lastPageRoute) {
    let pageId = lastPageRoute;
    // console.log("8888888888888888888888888",pageId)
    let number = 0;
    if (pageId == "pages/index/index") {
        number = 1;
    // } else if (pageId == "pages/report/page1/page1" && lastPageData.reportTheme == "hgjj") {
        
    } else if (pageId == "pages/product/entfirm/loans/detail/detail") {
        //获取产品详情
        number = "pd";
    } else if (pageId == "pages/index/voiceBroadcast/voiceBroadcast") {
        //获取活动详情
        number = "ac";
    } else if (pageId == "pages/mine/mine") {
        number = "login";
    }
    //  else if (pageId == "pages/report/page1/page1" && lastPageData.reportTheme == "ztbg") {
    //     number = 5;
    // } else if (pageId == "pages/mine/subscribe/subscribe") {
    //     number = 6;
    // } else if (pageId == "pages/mine/history/history") {
    //     number = 7;
    // } else if (pageId == "pages/mine/collect/collect") {
    //     number = 9;
    // } else if (pageId == "pages/report/pageHtml/pageHtml") {
    //     number = 10;
    // } else if (pageId == "pages/report/search/search") {
    //     number = 13;
    // }
     else {
        number = 0;
    }
    return number;
},
